import React from 'react';

function Window({heading, string}) {

  return (
    <div>
      Предпросмотр штампа
      <div>
      {heading}
      </div>
      <div>
        {string && string.map((item, index) => <div key={(index + 1)*Math.random()}>{item}</div>)}
      </div>
    </div>
  );
}

export default Window;
